import React from 'react';

function DiagnosisList() {
    return (
        <div>
            <h1 className="text-2xl font-bold mb-4">진료 내역 목록</h1>
            <p>이곳에서 진료 내역을 확인할 수 있습니다.</p>
            {/* 여기에 진료 내역 목록이 표시됩니다. */}
        </div>
    );
}

export default DiagnosisList;
